import React from "react";
import { DivFeed, Posts, DivCreatePost, DivListPost, DivHeader} from "./Styled-Feed";
import Header from "../../components/header/Header";
import foto1 from "../../constants/assets/UnionlogoG1.svg"


const FeedPage = () => {

    const noticiesPosts = [
                {
                    "id": 1,
                    "titulo": "Título do Post 1",
                    "materia": "Conteúdo da matéria do Post 1...",
                    "imagem": "https://example.com/image1.jpg",
                    "data": "2023-01-15"
                },
                {
                    "id": 2,
                    "titulo": "Título do Post 2",
                    "materia": "Conteúdo da matéria do Post 2...",
                    "imagem": "https://example.com/image2.jpg",
                    "data": "2023-01-16"
                },
                {
                    "id": 3,
                    "titulo": "Título do Post 3",
                    "materia": "Conteúdo da matéria do Post 3...",
                    "imagem": "https://example.com/image3.jpg",
                    "data": "2023-01-17"
                },
                {
                    "id": 3,
                    "titulo": "Título do Post 3",
                    "materia": "Conteúdo da matéria do Post 3...",
                    "imagem": "https://example.com/image3.jpg",
                    "data": "2023-01-17"
                },
                {
                    "id": 3,
                    "titulo": "Título do Post 3",
                    "materia": "Conteúdo da matéria do Post 3...",
                    "imagem": "https://example.com/image3.jpg",
                    "data": "2023-01-17"
                },
                {
                    "id": 3,
                    "titulo": "Título do Post 3",
                    "materia": "Conteúdo da matéria do Post 3...",
                    "imagem": "https://example.com/image3.jpg",
                    "data": "2023-01-17"
                }
    ];

     // Embaralha as notícias
  const aleatorePost = noticiesPosts.slice();
  aleatorePost.sort(() => Math.random() - 0.5);

   // Mostra apenas as 5 primeiras notícias
   const visiblePosts = aleatorePost.slice(0, 5);
    return(
        <DivFeed>
            <DivHeader>
            <Header />
            </DivHeader>
            <DivListPost>
                {visiblePosts.map((post) => (
                    <Posts>
                    <div key={post.id}>
                        <h5>{post.id}</h5>
                        <h2>{post.titulo}</h2>
                        <p>{post.materia}</p>
                        <img src={post.imagem} alt={post.titulo} />
                        <p>{post.data}</p>
                    </div>
                    </Posts>
                ))}
            </DivListPost>
        </DivFeed>
    )
}

export default FeedPage;
